    <body>
        <div class="mui-container">
            <h1>
                Přeru&scaron;en&iacute;
            </h1>
            <ul>
                <li>
                    Schopnost procesoru přeru&scaron;it pr&aacute;vě vykon&aacute;van&yacute; program a zač&iacute;t vykon&aacute;vat jin&yacute;(obsluhu přeru&scaron;en&iacute;)
                </li>
                <li>
                    Čast&aacute; věc při přep&iacute;n&aacute;n&iacute; procesů
                </li>
            </ul>
            <p>
                Typy přeru&scaron;en&iacute;:
            </p>
            <ul>
                <li>
                    Vněj&scaron;&iacute; (asynchronn&iacute;)
                    <ul>
                        <li>
                            nečekan&eacute;/nepl&aacute;novan&eacute;
                        </li>
                        <li>
                            zm&aacute;čknut&iacute; kl&aacute;vesy
                        </li>
                    </ul>
                </li>
                <li>
                    Vnitřn&iacute; (asynchronn&iacute;)
                    <ul>
                        <li>
                            Vykon&aacute;v&aacute; je s&aacute;m procesor
                        </li>
                        <li>
                            Probl&eacute;m s&nbsp;vykon&aacute;vanou instrukc&iacute;
                        </li>
                        <li>
                            Dělen&iacute; 0
                        </li>
                        <li>
                            Nečekan&eacute;
                        </li>
                    </ul>
                </li>
                <li>
                    SW (synchronn&iacute;)
                    <ul>
                        <li>
                            Speci&aacute;ln&iacute; strojov&aacute; instrukce
                        </li>
                        <li>
                            Oček&aacute;van&eacute;
                        </li>
                        <li>
                            Vypl&iacute;v&aacute; z&nbsp;podstaty programu
                        </li>
                    </ul>
                </li>
                <li>
                    Maskovan&eacute;
                    <ul>
                        <li>
                            Slouž&iacute; ovladačům
                        </li>
                    </ul>
                </li>
                <li>
                    Nemaskovan&eacute;
                    <ul>
                        <li>
                            V&yacute;padek zdrojů
                        </li>
                        <li>
                            Mus&iacute; se prov&eacute;st
                        </li>
                    </ul>
                </li>
                <li>
                    Sign&aacute;l přeru&scaron;en&iacute; přij&iacute;m&aacute; Interrupt Controler (řadič přeru&scaron;en&iacute;)
                </li>
                <li>
                    vys&iacute;l&aacute; ho např&iacute;klad periferie C8 kl&aacute;vesy, IC přijme požadavek na
                </li>
                <li>
                    přeru&scaron;en&iacute;, vyhodnot&iacute; prioritu s prob&iacute;haj&iacute;c&iacute;m procesem, řekne procesoru, že to bude
                </li>
                <li>
                    Procesor dokonč&iacute; instrukci a ulož&iacute; adresu n&aacute;sleduj&iacute;c&iacute; operace do Stacku (ulož&iacute; se tam i registry a tak d&aacute;le)
                </li>
                <li>
                    procesor jsi z řadiče vezme č&iacute;slo (každ&eacute; přeru&scaron;en&iacute; m&aacute; určen&eacute; č&iacute;slo, kter&eacute; popisuje
                </li>
                <li>
                    určitou službu) přeru&scaron;en&iacute;.
                </li>
                <li>
                    procesor hled&aacute; v tabulce vektory přeru&scaron;en&iacute; (co je &uacute;sek operačn&iacute; paměti)
                </li>
                <li>
                    vektory přeru&scaron;en&iacute; &ndash; virtu&aacute;ln&iacute; adres prvn&iacute; instrukce obsluhy přeru&scaron;en&iacute;. Ke každ&eacute;mu
                </li>
                <li>
                    č&iacute;slu přeru&scaron;en&iacute; n&aacute;lež&iacute; 1 vektor přeru&scaron;en&iacute;. Mus&iacute; jsi vypůjčit adresu.
                </li>
            </ul>
            <h1>
                DMA (Direct memory acess)
            </h1>
            <ul>
                <li>
                    souvis&iacute; s&nbsp;přeru&scaron;en&iacute;m
                </li>
                <li>
                    př&iacute;m&iacute; př&iacute;stup do paměti blokov&eacute;ho zař&iacute;zen&iacute; bez &uacute;časti procesoru (to jde pak rychleji, umožňuje zrychlen&iacute;)
                </li>
            </ul>
            <p>
                <strong>
                    zař&iacute;zen&iacute; se děl&iacute; na blokov&eacute; a bytov&eacute;
                </strong>
            </p>
            <p>
                <strong>
                    blokov&eacute; &ndash; v&scaron;echny paměti, harddisk, přenosy po s&iacute;ti
                </strong>
            </p>
            <p>
                <strong>
                    bytov&eacute; &ndash; např&iacute;klad kl&aacute;vesnice
                </strong>
            </p>
            <ul>
                <li>
                    <strong>
                        Proceso
                    </strong>
                    r naprogramuje DMA odkud, kolik a kam se bude přen&aacute;&scaron;et + č&iacute;slo přeru&scaron;en&iacute; nejpomalej&scaron;&iacute; periferie, kter&aacute; se bude přen&aacute;&scaron;et
                </li>
                <li>
                    DMA je ozn&aacute;meno, že může zač&iacute;t přenos
                </li>
                <li>
                    DMA vy&scaron;le př&iacute;kaz HOLD procesoru. Procesor ukonč&iacute; činnost na sběrnici, odpov&iacute; př&iacute;kazem HA (Hold accepted), ozn&aacute;m&iacute; opu&scaron;těn&iacute; sběrnice to odpoj&iacute; procesor od sběrnice
                </li>
                <li>
                    DMA děl&aacute; přenos hardwarově &ndash; pomoc&iacute; č&iacute;tače nastav&iacute; (procesor by musel m&iacute;t instrukce) adresy na sběrnici, snižuje se st&aacute;le dolů až na 0(pak je to hotovo)
                </li>
                <li>
                    použ&iacute;vaj&iacute; se pulzy (nikoli instrukce)
                </li>
            </ul>
            <h1>
                <img src="data:image/jpeg;base64,">
                Rozdělen&iacute; procesorů
            </h1>
            <table width="100%">
                <thead>
                    <th colspan="2"><center><span style="font-size: 150%;">ROZDĚLENÍ PODLE STRUKTURY</span></center></th>
                </thead>
                <tbody>
                    <td valign="top">
                        <p>
                            <strong>
                                Na Harvardsk&eacute; struktuře:
                            </strong>
                        </p>
                        <ul>
                            <li>
                                sběrnice pro data
                            </li>
                            <li>
                                sběrnice pro instrukce
                            </li>
                            <li>
                                paměť pro instrukce
                            </li>
                            <li>
                                paměť pro data
                            </li>
                            <li>
                                paměti mohou pracovat paralelně
                            </li>
                        </ul>
                    </td>
                    <td valign="top">
                        <p>
                            <strong>
                                Na Von Neumanově struktuře:
                            </strong>
                        </p>
                        <ul>
                            <li>
                                1 paměť pro data a instrukce dohromady
                            </li>
                            <li>
                                buď se zapisuj&iacute; data nebo instrukce
                            </li>
                        </ul>
                    </td>
                </tbody>
            </table>
            <table width="100%">
                <thead>
                    <th colspan="2"><center><span style="font-size: 150%;">ROZDĚLENÍ PODLE INSTRUKČNÍ SADY</span></center></th>
                </thead>
                <tbody>
                    <tr>
                        <td valign="top">
                            <p>
                                <strong>
                                    RISC (Reduced instruction set computer):
                                </strong>
                            </p>
                            <ul>
                                <li>
                                    m&aacute; jednotn&yacute; HW
                                </li>
                                <li>
                                    m&aacute; složitěj&scaron;&iacute; program assembleru
                                </li>
                                <li>
                                    v každ&eacute;m taktu je ukončena 1 instrukce
                                </li>
                                <li>
                                    je nutn&yacute; pipelining
                                </li>
                                <li>
                                    obsahuje velk&yacute; počet registrů
                                </li>
                                <li>
                                    obsah registů nen&iacute; nutn&eacute; přehr&aacute;vat jinam, registry se pouze přejmenuj&iacute;(přeadresuj&iacute;)
                                </li>
                                <li>
                                    jsou zde banky registů, když se změn&iacute; PREFIX tak se změn&iacute; registr
                                    <ul>
                                        <li>
                                            PREFIX &ndash; č&aacute;st adresy
                                            <ul>
                                                <li>
                                                    nahr&aacute;v&aacute; se do Stacku
                                                </li>
                                                <li>
                                                    nemaj&iacute; pevn&yacute; akumul&aacute;tor (nen&iacute; pevně připojen na ALU)
                                                </li>
                                                <li>
                                                    jako akumul&aacute;tor může sloužit libovoln&yacute; registr
                                                </li>
                                            </ul>
                                        </li>
                                    </ul>
                                </li>
                                <li>
                                    mal&yacute; počet instrukc&iacute;, del&scaron;&iacute; program assembleru
                                </li>
                                <li>
                                    pouze 2 instrukce pro pr&aacute;ci s pamět&iacute; (LOAD, STORE)
                                </li>
                                <li>
                                    optimalizovan&yacute; kompil&aacute;tor um&iacute; pracovat s blokovou algebrou
                                </li>
                                <li>
                                    dok&aacute;že přehazovat instrukce
                                </li>
                            </ul>
                        </td>
                        <td valign="top">
                            <p>
                                <strong>
                                    CISC (Complex instruction set computer):
                                </strong>
                            </p>
                            <ul>
                                <li>
                                    maj&iacute; akumul&aacute;tor pevně v&aacute;zan&yacute; na ALU
                                </li>
                                <li>
                                    instrukce se nejdř&iacute;v přelož&iacute; na mikroinstrukce a potom do strojov&eacute;ho k&oacute;du dvoj&iacute; překlad
                                </li>
                            </ul>
                        </td>
                    </tr>
                </tbody>
            </table>
            <p>
                <strong>
                    Parametry procesoru:
                </strong>
            </p>
            <ul>
                <li>
                    rychlost(frekvence) - počet operac&iacute; za sekundu, ud&aacute;v&aacute; se v&nbsp;Hz
                </li>
                <li>
                    efektivita mikrok&oacute;du &ndash; počet kroků na proveden&iacute; jedn&eacute; instrukce
                </li>
                <li>
                    numerick&yacute; Koprocesor FPU &ndash; buďto nen&iacute;/je př&iacute;tomen, operace v plovouc&iacute; desetinn&eacute; č&aacute;rce
                </li>
                <li>
                    počet instrukčn&iacute;ch kmitů &ndash; maxim&aacute;ln&iacute; počet instrukc&iacute; v jednom taktu(pipelingu)
                </li>
                <li>
                    &scaron;&iacute;řka slova &ndash; maxim&aacute;ln&iacute; počet bitů, kter&eacute; je možn&eacute; zpracovat během jedn&eacute; operace (8, 16, 32, 64 bitov&yacute;)
                </li>
            </ul>
